import './Togler.css'
function Togler() {
    const myFunction =()=> {
        var element = document.getElementById("hidden");
        element.classList.toggle("mynewclass");
        console.log(element);
        console.log(element.classList);
     }

    return (
        <div>
            <button onClick={myFunction}>Click</button>
            <div id='hidden' className='hidden'>
                <h1>After click</h1>
            </div>
        </div>
    )
}
export default Togler
